  false,\n\t\"url\": null,\n\t\"notes\": \"LOCATION: Lat. 43o21u201938u201d N, long.
  84o02u201918u2019u2019W, approximately 4 miles southwest of Saginaw, MI, Saginaw
  County. Gage is located on Shiawassee National Wildlife Refuge DRAINAGE AREA: 2,599
  square miles SURFACE WATER RECORDS PERIOD OF RECORD: Regional Office data analysis
  May 19 to present. GAGE SITE: Design Analysis H522+ datalogger in communication
  with KPSI submersible pressure transducer and GOES antenna, powered through Solar
  Controller voltage regulator with 12V battery and solar panel. Gage installed in
  metal enclosure 15u2019 above ground on tree. Stage data collected at 15 minute
  intervals. Weekly gage height data available online, NWS Id is JTSM4. Datum of gage
  is in North American Vertical Datum of 1988. NATIONAL WILDLIFE REFUGE: Shiawassee
  NWRREMARKS: Stage records coded FAIR for 2012 calendar year. EXTREMES FOR PERIOD
  OF RECORD: Maximum gage height, 580.57 ft, October 30, 2012; minimum gage height
  576.39 ft, November 25, 2012. EXTREMES FOR CURRENT YEAR: Maximum gage height, 580.57
